contract BTLIdo is Initializable,ReentrancyGuard{
    using SafeERC20 for IERC20;
    address public owner;

    IUniswapV2Router02 public  uniswapV2Router;
    address public btlToken;
    address public USDT;
    address public matrix;
    address public vaultAddress;
    address public idoEndWallet;

    uint256 public minIdo;
    uint256 public minBindFee;
    uint256 public idoStart;
    uint256 public idoEnd;
    uint256 public exchangeRatio;//base 10000
    uint256 public supplyIdo;

    bool public noFeeTransfer;

    mapping (address => Types.Ido) public idos;
    mapping (address => address) public bindInvites;

    event SHARE_SUPERIOR(address buyer,address superior,uint256 amount);
    event CLAIM(address owner, uint256 amount, address junior, uint256 shareAmount);
    event ENTRY(address newNode, address pNode, bool isGlobal, uint64 id);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event IDO(address account,address superior,uint256 amount);
    event RELEASE(address account, uint256 usdtAmount, uint256 btlAmount);
    event BIND(address account,address superior,uint256 amount);

    modifier onlyOwner() {
        require(owner == msg.sender, "Ownable: caller is not the owner");
        _;
    }

    constructor(address _btlToken, address _router, address _usdt, address _matrix, address _vaultAddress, address _idoEndWallet, address _owner){
    // function initialize(address _btlToken, address _router, address _usdt, address _matrix, address _vaultAddress, address _idoEndWallet, address _owner) public initializer {
        owner = _owner;
        btlToken = _btlToken;

        uniswapV2Router = IUniswapV2Router02(_router);
        USDT = _usdt;
        vaultAddress = _vaultAddress;
        idoEndWallet = _idoEndWallet;
        matrix = _matrix;

        minIdo = 100e18;
        minBindFee = 35e18;
        idoStart = block.timestamp;
        idoEnd = block.timestamp + 24*3600;//1689260400;//0713:23:00//type(uint256).max;
        exchangeRatio = 10000;//base 10000

        IERC20(USDT).safeApprove(address(uniswapV2Router),type(uint256).max);
    }

    function setBTLToken(address _btl) external onlyOwner{
        require(_btl != address(0),"zero address");
        btlToken = _btl;
    }

    function setMinBindFee(uint256 _fee) external onlyOwner{
        minBindFee = _fee;
    }

    function setExchangeRatio(uint256 _ratio) external onlyOwner{
        exchangeRatio = _ratio;
    }

    function setIdoStart(uint256 _timestamp) external onlyOwner{
        require(_timestamp > block.timestamp,"error timestamp");
        idoStart = _timestamp;
    }

    function setIdoEnd(uint256 _timestamp) external onlyOwner{
        require(_timestamp > idoStart,"error timestamp");
        idoEnd = _timestamp;
    }

    function setMinIdo(uint256 _minIdo) external onlyOwner{
        require(_minIdo > 0, "zero amount");
        minIdo = _minIdo;
    }

    function joinIdo(address _superior, uint256 _amount) external nonReentrant{
        require(block.timestamp >= idoStart,"ido hasn't started yet");
        require(block.timestamp <= idoEnd && IERC20(btlToken).balanceOf(address(this)) == 0,"Ido ended");
        Types.Ido storage iaccount = idos[msg.sender];
        require(iaccount.usdtAmount == 0,"account already joined");
        require(idos[_superior].usdtAmount > 0 || _superior==matrix,"Referrer address is invalid");
        require(_amount>=minIdo,"less then min ido fee");
        IERC20(USDT).safeTransferFrom(msg.sender, vaultAddress, _amount);
        iaccount.usdtAmount = _amount;
        supplyIdo += _amount;

        bool isGlobal = _superior == matrix ? true : false;
        IBTLMatrix(matrix).entryMatrix(msg.sender, _superior, isGlobal);

        emit IDO(msg.sender, _superior, _amount);
    }

    function release() external nonReentrant {
        require(IERC20(btlToken).balanceOf(address(this)) > 0,"Not yet claim time");
        Types.Ido storage iacc = idos[msg.sender];
        require(iacc.usdtAmount > 0,"account not ido");
        require(iacc.btlAmount == 0,"already claimed");
        iacc.btlAmount = iacc.usdtAmount * exchangeRatio / 10000;
        if(idoEnd > block.timestamp) idoEnd = block.timestamp;

        IERC20(btlToken).transfer(msg.sender, iacc.btlAmount);
        emit RELEASE(msg.sender, iacc.usdtAmount, iacc.btlAmount);
    }

    function nftQualification(address _account) external view returns (bool){
        Types.Ido memory iacc = idos[_account];console.log("1-->",iacc.usdtAmount);
        if(iacc.usdtAmount == 0) return false;
        (uint64 id,,uint8 juniorNum,uint64[] memory juniors) = IBTLMatrix(matrix).getNode(_account);
        if(id==0 || juniorNum < 5) return false;
        for(uint8 i;i<5;i++){
            if(idos[ IBTLMatrix(matrix).ids(juniors[i]) ].usdtAmount == 0) return false;
        }
        return true;
    }

    function _bounderBuy(address buyer) internal {
        // buy 7
        Types.Ido storage iacc = idos[buyer];
        // Types.Node storage snode = nodes[buyer];
        if(iacc.accFee == 0 || iacc.bounds % 5 != 0)return;

        uint256 curShare = iacc.accFee;
        iacc.accFee = 0;

        if(IERC20(USDT).balanceOf(address(this)) < curShare 
            && IERC20(btlToken).balanceOf(btlToken)>0){
            IBTLToken(btlToken).swapAndSettling();
        }

        for(uint8 i;i<7;i++){
            IBTLMatrix(matrix).shareToSuperior(buyer, curShare/7*IBTLToken(btlToken).shareFee() / 100, curShare/7);
        }

        IERC20(USDT).safeTransfer(IBTLToken(btlToken).ecoAddress(), curShare * IBTLToken(btlToken).ecoFee() / 100);
        uint256 buyBtlfunds = curShare * (100 - IBTLToken(btlToken).ecoFee() - IBTLToken(btlToken).shareFee()) / 100;
        
        noFeeTransfer = true;

        address[] memory path = new address[](2);
        path[0] = USDT;
        path[1] = btlToken;
        if(IERC20(USDT).allowance(address(this), address(uniswapV2Router))>0){
            IERC20(USDT).safeApprove(address(uniswapV2Router),0);
        }
        IERC20(USDT).safeApprove(address(uniswapV2Router), buyBtlfunds);
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            buyBtlfunds,
            0,
            path,
            buyer,
            block.timestamp
        );

        noFeeTransfer = false;
    }

    function bind(address _superior, uint256 _amount) external nonReentrant{
        require(block.timestamp > idoEnd,"ido now");
        require(IBTLMatrix(matrix).getNodeId(_superior) > 0,"superior not bound");
        require(_amount>=minBindFee,"less then min ido fee");
        require(IBTLMatrix(matrix).getNodeId(msg.sender) == 0, "already bound");
        
        IERC20(USDT).safeTransferFrom(msg.sender, _superior, _amount * 50 / 100);
        IERC20(USDT).safeTransferFrom(msg.sender, idoEndWallet, _amount * 30 / 100);
        IERC20(USDT).safeTransferFrom(msg.sender, address(this), _amount * 20 / 100);

        IBTLMatrix(matrix).entryMatrix(msg.sender, _superior, false);

        Types.Ido storage iacc = idos[msg.sender];
        iacc.paid += uint128(_amount);
        // Types.Node storage node = nodes[msg.sender];
        // node.paid += uint128(_amount);

        Types.Ido storage iaccSup = idos[_superior];
        iaccSup.accFee += uint128(_amount * 20 / 100);
        iaccSup.bounds += 1;
        // Types.Node storage snode = nodes[_superior];
        // snode.accFee += uint128(_amount * 20 / 100);
        // snode.bounds += 1;

        if(iaccSup.bounds % 5 == 0){
            _bounderBuy(_superior);            
        }
        
        emit BIND(msg.sender, _superior, _amount);
    }

    function bindInvite(address _from, address _to) external {
        require(msg.sender == matrix,"only matrix");
        if(_to==address(0) || _to==IBTLToken(btlToken).uniswapV2Pair())return;
        if(bindInvites[_to]!=address(0) || idos[_to].usdtAmount>0) return;
        if(_from==address(0)) _from=address(this);
        bindInvites[_to] = _from;
    }

    function joinFee(uint256 _amount) external nonReentrant{        
        require(_amount>=minBindFee,"less then min ido fee");
        require(IBTLMatrix(matrix).getNodeId(msg.sender) > 0, "non-bound");
        require(idos[msg.sender].paid == 0, "already paid");
        

        address superior = bindInvites[msg.sender];
        require(superior != address(0),"non bind invite");

        if(superior == address(this)){
            IERC20(USDT).safeTransferFrom(msg.sender, idoEndWallet, _amount * 50 / 100);
            IERC20(USDT).safeTransferFrom(msg.sender, IBTLMatrix(matrix).vaultAddress(), _amount * 50 / 100);
        }else{
            IERC20(USDT).safeTransferFrom(msg.sender, superior, _amount * 50 / 100);
            IERC20(USDT).safeTransferFrom(msg.sender, idoEndWallet, _amount * 30 / 100);
            IERC20(USDT).safeTransferFrom(msg.sender, address(this), _amount * 20 / 100);

            Types.Ido storage iaccSup = idos[superior];
            iaccSup.accFee += uint128(_amount * 20 / 100);
            iaccSup.bounds += 1;
            // Types.Node storage snode = nodes[superior];
            // snode.accFee += uint128(_amount * 20 / 100);
            // snode.bounds += 1;

            if(iaccSup.bounds % 5 == 0){
                _bounderBuy(superior);            
            }
        }
        Types.Ido storage iacc = idos[msg.sender];
        iacc.paid += uint128(_amount);

    }

    function paid(address _account) external view returns (bool){
        if(idos[_account].usdtAmount >0 || idos[_account].paid>0) return true;
        return false;
    }

    function idoInfo(address _account) external view returns (
        uint256 usdtAmount_,
        uint256 btlAmount_,
        uint8 bounds_,
        uint128 paid_,
        uint128 accFee_,
        uint256 supplyIdo_,
        uint256 pending_,
        bool isEnd_,
        bool isBind_,
        uint256 minFee_
    ){
        Types.Ido memory ido = idos[_account];
        isEnd_ = false;    
        if(IERC20(btlToken).balanceOf(address(this))>0 || block.timestamp > idoEnd) isEnd_ = true;
        
        isBind_ = false;
        if(ido.usdtAmount>0 || bindInvites[_account]!=address(0)) isBind_ = true;

        minFee_ = minIdo;
        if(isEnd_) minFee_ = minBindFee;
        
        return (ido.usdtAmount,ido.btlAmount,ido.bounds,ido.paid,ido.accFee,supplyIdo,ido.usdtAmount*exchangeRatio/10000,isEnd_,isBind_,minFee_);
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _transferOwnership(newOwner);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Internal function without access restriction.
     */
    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = owner;
        owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }

     /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        _transferOwnership(address(0));
    } 
}
